var TOCYloc=null;var TOCposition=null;var TOCtop=null;function initSBSCommitDiff(){var a=$("div.commitDiffSBS div.SBSTOC");if(a.size()<1){return}TOCYloc=a.position().top;TOCposition=a.css("position");TOCtop=a.css("top");$(window).scroll(function(){var b=$(document).scrollTop();if(b>TOCYloc){a.css("position","fixed");a.css("top","0px")}else{a.css("position",TOCposition);a.css("top",TOCtop)}});$("a.SBSTOCItem").click(function(){var b=$(this).get(0);$("a.SBSTOCItem").each(function(d,e){if(b==e){$(this).parent().addClass("activeItem")}else{$(this).parent().removeClass("activeItem")}});var c=$(this).attr("href").substring(1);$("div.diffBlob").each(function(){if($(this).attr("id")==c){$(this).slideDown("fast")}else{$(this).slideUp("fast")}});$("a.showAll").show();if($(document).scrollTop()>$("div.SBSContent").offset().top){$("html, body").animate({scrollTop:$("div.SBSContent").offset().top},200)}return false});$("a.showAll").click(function(){$("a.SBSTOCItem").parent().removeClass("activeItem");$("div.diffBlob").slideDown("fast");$(this).hide();if($(document).scrollTop()>$("div.SBSContent").offset().top){$("html, body").animate({scrollTop:$("div.SBSContent").offset().top},200)}return false})}$(document).ready(function(){initSBSCommitDiff()});